import Tasks from "./Tasks";

export default function TaskList() {
const taskList = [
    { id: 1, task: 'Dishes', description: "wash the dishes in the kitchen" }
]
return (
<div className = "task-list">
{taskList.map((task) => (
    <Tasks key={task.id}></Tasks>
))}
</div>
)
}
